import * as React from 'react'
import { goBack as goBackAction } from 'react-router-redux'
import { ActionPage } from '@opencrvs/components/lib/interface'
import { connect } from 'react-redux'
import { defineMessages, InjectedIntlProps, injectIntl } from 'react-intl'
import styled from 'styled-components'

const messages = defineMessages({
  preview: {
    id: 'register.form.documentPreview',
    defaultMessage: 'Preview',
    description: 'Action Page Title'
  }
})

type Props = {
  goBack: typeof goBackAction
}

const Image = styled.img`
  width: 100%;
`

class DocumentPreviewView extends React.Component<Props & InjectedIntlProps> {
  render() {
    const { goBack, intl } = this.props
    const base64Img = `data:image/jpeg;base64,`

    return (
      <>
        <ActionPage
          goBack={goBack}
          title={intl.formatMessage(messages.preview)}
        >
          <Image id="document_preview" src={base64Img} />
        </ActionPage>
      </>
    )
  }
}
export const DocumentPreview = connect(null, { goBack: goBackAction })(
  injectIntl(DocumentPreviewView)
)
